INSERT INTO `recipes` VALUES (3,'Homemade Pierogi','Pierogi, boiled dumplings, are very flexible and can be stuffed with a number of savory or sweet fillings, including potato and cheese (below); sauerkraut, cabbage, spiced meats, and even fruits and berries. Because pierogi freeze well, they make quick, satisfying last-minute meals. There are as many versions of pierogi as there are cooks who love them, and our take on this traditional treat mirrors many Polish pierogi recipes.','To make the dough: Mix together the flour and salt. Add the egg to the flour and combine. The dough will be quite clumpy at this stage.;Work in the sour cream and soft butter until the dough comes together in a slightly rough, slightly sticky ball.;Using just your fingertips, knead and fold the dough without adding additional flour until the dough becomes less sticky but still quite moist.;Wrap the dough well in plastic wrap and refrigerate for 30 to 60 minutes, or up to 48 hours.;To make the filling: Combine the warm mashed potato and cheese. Stir and mash until the cheese is melted and the filling is cool to the touch. Taste and adjust the seasonings with salt and pepper.;To fill the pierogi: Roll half the dough 1/8\" thick. Use a 2\" round cutter to cut circles of dough. Repeat with the other half of the dough. Save the scraps, these can be snipped into small pieces and added to simmering soups.;Place 1 1/2 teaspoons of filling on each round of dough. Gently fold the dough over, forming a pocket around the filling. Pinch the edges of the pierogi to seal, then seal again with the tines of a fork.;At this point the pierogi can be frozen for up to 4 weeks, or refrigerated overnight, or cooked in a large stockpot of boiling salted water. Only cook about 10 pierogi at a time, so that they have room to float without sticking. When the pierogi float, they\'re done. The time will vary depending on if they\'re fresh or frozen.;Sauté the shallots or onion in the butter in a large skillet until the onion begins to brown. Add the drained pierogi and cook until browned and crisped. Serve hot with additional sour cream, applesauce, or other condiments.','Are pierogi a new dish for you? These savory filled dumplings were originally peasant fare native to Central and Eastern Europe, but they\'ve overcome class boundaries and become popular among those from all walks of life. While homemade pierogi are an important part of Christmas Eve celebrations in many homes, they aren\'t limited to the holidays; most folks enjoy them all year long, and family gatherings just have to have pierogi to be complete. They’re also very popular at festivals: The annual Pierogi Festival in Kraków, Poland, typically serves 30,000 pierogi a day.','2022-05-17',1,0,4,15),(4,'Stir-fried Beef','This is a Chinese meal, refreshing and tender, perfect for pairing with rice.','Chop beef to thin slices.;Add corn starch, light soy sauce, thick oyster sauce, and sugar to beef, mix well, marinade for 1 hour.;Fry beef until color changes, take beef out.;Fry chili and press the garlic in hot oil, then put beef, dark soy sauce, ground black pepper, cook for 2 minutes.;Put dill in pot and stop heat, mix well and take meal out. ','I suggest you use steak cuts.','2022-05-17',6,0,2,16),(9,'American Flag Pie','This country\'s independence is worth a show-stopping dessert, and we think this pie is it. Bursting with summer flavors — strawberry and rhubarb — and decorated to honor the Stars and Stripes, this pie will guarantee that you\'ll have no trouble competing with fireworks this year!','To make the crust: Divide the pastry into two pieces — one about 2/3 of the total, the other 1/3. Roll the larger piece of pastry into a round, and place it in a 9\" pie pan. Refrigerate for at least 30 minutes.; Preheat the oven to 425°F.; To make the strawberry-rhubarb filling: Whisk together the sugar, enhancer, and salt, and toss with the rhubarb and strawberries. Set aside.; To make the blueberry filling: Whisk together the sugar and enhancer. Toss the blueberries with the sugar mixture, then stir in the lemon juice.; Fill a 90° wedge of the pie shell with blueberry filling and the remaining 270° wedge with strawberry-rhubarb filling. ; Roll the remaining crust into a 10\" x 6\" rectangle about 3/8\" thick. Cut the dough, lengthwise, into five to six 3/4\"-wide, 10\"-long strips. Cut three to five 1 1/4\" stars from the remaining dough.; Place the strips parallel to one another over the strawberry-rhubarb section, cutting any excess off the ends and pinching them to the edge of the crust.; Place the stars atop the blueberry filling.; Brush stars, stripes, and outer crust with water, and sprinkle with sparkling sugar, if desired.; Place the pie on a baking sheet (to catch the drips), and bake for 30 minutes. Reduce the oven heat to 375°F and bake for an additional 45 to 60 minutes, until the filling is bubbling and the crust nicely browned.; Remove the pie from the oven, and let it cool for at least an hour before serving. If you can\'t wait, the pie may be served warm but it\'ll be a bit messy;  it sets as it cools.','If rhubarb isn\'t in season or available in your area, use all strawberries for the red portion of your pie. Combine 5 to 6 cups hulled and quartered strawberries with 1/2 cup Pie Filling Enhancer and 2 teaspoons lemon juice. Finish and bake the pie according to the recipe instructions.','2022-05-18',1,0,4,26),(20,'Ghosty chicken katsu curry','This is a cheat recipe of how to make this delicious chicken katsu. For Asian people using ready made curry paste is absolutely normal. If I have time I will make it from scratch but for quick and easy version the ready made paste is so convenient. I use ready make japanese curry paste in this recipe but I also have a homemade Japanese curry paste recipe too you can check it out.','Put oil into a pot and sauté onion pieces until the edges start browning; Add potato and carrot pieces to the pot and stir.; Add water and bring it to a boil. Remove scum as it rises.; Add curry roux and cook.; Cook chicken cutlets and slice them.; Put cooked rice on one side of a serving plate, place cutlet pieces next to the rice.; Pour curry on the side next to the cutlet away from the rice.','Hope you enjoy this delicious and spooky meal!','2022-05-27',1,0,2,55),(21,'Stir-Fried Celtuce Stem','Celtuce is also called Chinese lettuce or Chinese stem celtuce. It is not a common vegetable in western countries but I feel it is necessary to introduce it to you since its great taste and of cause the green color.','Peel the skin of stem. Then cut it into long trips. Chop garlic clove and cut ginger into shreds.; Rise the long trips in boiling water for around 1 minute (control the time in order to keep the original color). Remove from the wok and set aside.; Heat up some oil in wok;  add ginger, garlic and Sichuan peppercorn to stir-fry until smelling the taste of garlic and peppercorn. Add cooked long trips and quick fry for about 1 minute.; Add salt, mix together and serve.','','2022-05-27',5,0,2,56),(23,'Szechuan Fish - Suan Cai Yu','Szechuan style fish stew with pickled mustard greens. This is not a famous dish but its a classic Szechuan style food.','Wash the fish carefully and separate the bones and fish fillet. Then slice the fillet into really thin slices and cut the bones into large sections. Separate the fish pieces and the bones.; Add salt in fish meat and bones. Mix for a while until the meat becomes sticky.  Then wash the fish slices until they become almost transparent. Transfer out and drain. This step helps to remove any odd taste and give the meat a lovely texture. Repeat the process and clean the fish bones too.; Marinade the fish bones and fish fillet slices with salt, egg white, cornstarch and white pepper powder. Set aside.; Add a small amount of oil in wok and fry mustard green until dried and place dried chili pepper and Sichuan peppercorn. Continue heating until aromatic. Pour extra oil and fry garlic, ginger and green onion white section until aromatic too. Transfer out.; Clean the wok and re-heat some oil, add the fish head and bones and fry until slightly browned. Place the fried mustard green in. Pour in 800ml hot water. Let the broth simmer for 15 minutes.  Transfer the solid content to serving plate. ; Add fish slices in and cook for 30 seconds until they turn white. Transfer out immediately. ; Top with chopped garlic, Sichuan peppercorn and chopped green onions. Pour around 2 tablespoons of hot oil.  Serve hot! ','For a better taste, you can add some pickled peppers.','2022-05-27',5,0,1,57),(24,'Pyttipanna','Swedish dish Pyttipanna','Roughly dice the peeled potatoes, bacon, meat and sausage into 1 cm (½”) cubes or smaller. Finely chop the onion.; Heat a large non-stick frying pan or wok on a medium heat. Add the oil and butter and when foaming add the potatoes. After about 10 minutes add the onions and fry until golden brown. Don\'t stir the mixture too much, so that the potatoes have plenty of time to brown, allowing 20-30 minutes in total. (The time depends on the potato variety.); Meanwhile, heat a separate pan and when hot add the diced bacon. When the bacon fat starts to run add the meat, smoked sausage and fresh thyme. Fry until the bacon is nicely browned and the meat is warmed through, stirring occasionally.; When the meat is cooked, add to the potatoes and mix thoroughly. Taste and add seasoning. It will probably need pepper and maybe Worcester sauce, but it may not require any salt as the bacon is likely to be fairly salty.; Keep warm whilst you fry the eggs.; Serve on to hot plates with an egg, a side serving of inlagda rödbetor (pickled beetroot) and garnish with finely chopped parsley.','','2022-05-27',7,0,2,58),(31,'Cranberry-Fudge Pie','This chocolate pie, with its flaky pastry crust and glistening, ruby-colored cranberry topping, delivers flavor in spades. With a semisweet chocolate ganache, nutty whole-grain flour in the crust, and tangy fruit, it has a little something for everyone.','To make the crust: In a medium bowl, whisk together the dry ingredients. Add the shortening and mix until everything is uniform and crumbly. Work in the butter, leaving some in dime-sized chunks. Drizzle the orange juice into the bowl while tossing the mixture with a fork. Add the water a tablespoon at a time, mixing until the dough begins to gather around the fork. The mixture should hold together when gently squeezed.; Transfer the mixture to a piece of parchment;  use the parchment to fold the dough over on itself four or five times, until the dough comes together. Pat it into a disk about 3/4\" thick, wrap in plastic, and refrigerate for at least 30 minutes.; Preheat the oven to 400°F. Lightly grease a 9\" pie pan that’s at least 1 1/2\" deep.; Roll the crust into a 13\" circle. Transfer it to the prepared pie pan, prick it all over with a fork, then trim and flute the edges. Line the crust with foil or parchment and pie weights and bake for 20 minutes. Remove it from the oven, remove the weights and liner, and return to the oven for 10 to 12 minutes, until the center is light golden brown. Remove the crust from the oven and let it cool to room temperature.; To make the chocolate filling: Combine the chocolate chips and cream in a medium microwave-safe bowl and heat for 90 seconds. Remove from the microwave and stir until the mixture is smooth, with no lumps. Pour the chocolate into the bottom of the baked pie shell and smooth the top with an offset spatula. Refrigerate the pie for 2 hours, until the ganache is firm.; To make the cranberry topping: Place the cranberries, sugar, and salt in a 2-quart saucepan. Add 3/4 cup of the cranberry juice;  reserve the rest. Place the saucepan over medium heat and bring to a simmer. Cook, stirring occasionally, until the berries begin to pop and the mixture thickens slightly.; While the berries are cooking, sprinkle the gelatin over the remaining cranberry juice;  stir after 1 minute if any dry spots remain. Once hydrated, stir the gelatin/juice mixture into the hot cranberry mixture.; Remove the cranberry topping from the heat and transfer it to a bowl. Refrigerate for 30 to 40 minutes, stirring every 10 minutes. When the filling is barely lukewarm but still fluid, pour it over the chilled chocolate filling in the pie shell.; Refrigerate the pie for at least four hours (preferably overnight) before slicing.; Store any leftovers, covered and refrigerated, for up to five days.','If you want to use just a single 12-ounce bag of fresh cranberries, and have dried cranberries in your pantry, try this: In a medium saucepan set over medium-high heat, bring 1 cup (198g) granulated sugar, 1/8 teaspoon salt, and 1 1/2 cups (340g) cranberry juice to a boil. Stir in 1 cup (170g) dried cranberries, reduce the heat, and simmer the mixture for 5 minutes, stirring occasionally. Add a 12-ounce bag fresh or frozen cranberries (340g, a generous 3 cups) and simmer, stirring occasionally, for 5 to 7 minutes, until some of the berries have burst. Remove the berries from the heat, pour them into a bowl, and chill. You\'ll need 15 ounces (425g, about 1 1/2 cups topping) for the pie; enjoy the rest on its own.','2022-05-27',1,0,4,66),(40,'Spinach and Strawberry Salad','My family loves this all year round if we can find strawberries. Even the grandchildren love this salad. Quick and easy','In a large bowl, toss together the spinach and strawberries.; In a medium bowl, whisk together the oil, vinegar, sugar, paprika, sesame seeds, and poppy seeds.; Pour over the spinach and strawberries, and toss to coat.','Nutrition Facts Per Serving: 235 calories; protein 3.6g; carbohydrates 22.8g; fat 15.9g; sodium 69.3mg.','2022-05-28',2,0,8,74),(41,'Sesame Noodles','This homemade sauce makes a sweet and spicy foil for linguine. The best sesame noodles I have every had!','Bring a pot of lightly salted water to boil. Add pasta, and cook until al dente, about 8 to 10 minutes. Drain, and transfer to a serving bowl.; Meanwhile, place a saucepan over medium-high heat. Stir in garlic, sugar, oil, vinegar, soy sauce, sesame oil, and chili sauce.; Bring to a boil, stirring constantly, until sugar dissolves.; Pour sauce over linguine, and toss to coat. Garnish with green onions and sesame seeds.','Nutrition Facts Per Serving: 371 calories; protein 7.9g; carbohydrates 52g; fat 14.8g; sodium 699.2mg.','2022-05-28',2,0,8,75),(42,'Yuxiang shredded pork','It\'s just a few simple combinations, but it has meat and vegetarian food. You can still taste the taste of fish without seeing the fish, and the color and aroma are good. It is very good for rice.','shred lean pork, carrot, green pepper, edible tree fungus; Marinate the shredded pork with a little salt, cooking wine and starch. Mix starch, salt, sugar, vinegar, soy sauce, broth (or water) into sauce.; Put cold oil in a hot pan, after the oil is warm, quickly stir-fry the shredded pork and spread it out.; Fry until the meat turns white, use a spatula to move the shredded pork to the side of the pot (or take it out), add homemade chopped peppers, minced garlic, and minced ginger to the base oil and fry until fragrant.; Add the shredded carrots, edible tree fungus and green pepper, and stir-fry for about a minute.; add sauce.','','2022-05-29',6,0,2,76),(43,'Pineapple fried rice','One big pineapple, eat half of it and arrange pineapple fried rice for the rest.','braised rice.; Remove the pineapple flesh and save the shell for later use.; Fried shrimp, scrambled eggs, and set aside. Heat the oil in the wok, add the sausage and stir fry until fragrant, add the green beans, corn and radish that have been blanched in water in advance, stir fry evenly and place the rice.; Stir-fry for a while, add a little salt, 2 tablespoons of soy sauce, and a tablespoon of oyster sauce, stir-fry evenly, then pour in diced pineapple and eggs, stir-fry for 1 minute to taste, put in the pineapple shell, put shrimp and sprinkle with chopped green onion.','With colors and ingredients, the delicious pineapple fried rice is ready. It has all the colors and flavors. Promise me to try it.','2022-05-29',6,0,2,77),(44,'Strawberry snowman','Today I am sharing a super cute Christmas strawberry snowman, it is so cute, it is super suitable for afternoon tea or serving! Hurry up and learn!','Soak strawberries in salt water and starch and wash them clean.; Remove the leaves from the strawberries and divide them into two from the middle.; Peel the banana and cut it into sections.; Arrange strawberries and bananas according to the picture, and decorate the eyes and mouth.','You can use black sesame to make eyes and carrot to make nose, to make it looks better!','2022-05-29',6,0,1,78),(45,'Spicy incense pot','There are seafood, vegetables, meat, meatballs, spicy and more addicting, don\'t miss it if you like it!','Prepare all the ingredients by yourself, boil water in the pot, first add corn, shrimp, squid and cook for a while, then add hot pot balls, finally add vegetables, cook and remove water for later use.; Add garlic, pepper, hotpot seasoning when the oil is hot and add a spoonful of Pixian bean paste, add all the ingredients and stir fry evenly, add a spoonful of soy sauce, a spoonful of oyster sauce, a little salt, and sugar, stir fry evenly, sprinkle sesame seeds before serving.','You can add ingredients you like too!','2022-05-29',6,0,2,79),(46,'Fried Pork in Scoop','This is a traditional Chinese food, try it if you like sweet taste.','Slice the tenderloin, soak in water to remove the blood. Soak potato starch in water and pour out excess water.; Remove water of meat slices, add salt and cooking wine, stir and marinate evenly.; Three spoons of sugar, four spoons of vinegar, salt, monosodium glutamate, and a drop of dark soy sauce, stir well and set aside.; Grab the starch block into the meat, add a spoonful of raw soybean oil, gently grasp and mix evenly.; When temperature of the oil is 60% hot, deep-fry the meat until it changes color, get it out, and fry it again, the starchy golden-yellow meat is jujube red, get it out, and remove oil.; Put oil in the pot, add sweet and sour sauce(made it in step3), add meat slices, stir fry quickly.','The ratio of sweet and sour sauce can be fine-tuned according to your own taste.','2022-05-29',4,0,1,80),(47,'Beef curry','This is a popular dish that fits people of all ages.','Dice potatoes and carrots.; Cut the beef into small pieces, add 2 spoons of cooking wine, 2 spoons of soy sauce, 2 spoons of starch, stir well and marinate for 10 minutes.; Heat a pan with less oil, add carrots and potatoes, fry until discolored, then set aside.; Add a little more oil to the pot, add the beef when the oil is hot, fry until it is bloodless, add boiling water, about 2 bowls. Bring to a boil and simmer for 30 minutes.; Add carrots and potatoes and continue to simmer for 10 minutes.; Pour in the curry.; Turn off the heat and cover the pot and simmer for three minutes.','No need to add salt, because the curry you bought has salt in it.','2022-05-29',4,0,2,81),(48,'Chocolate cake','A nice cake!','Put the eggs in an oil-free and water-free basin, and beat until the egg beater is not easily lowered quickly. Add the sifted low-gluten flour and cocoa powder and mix well.; Take a small amount of batter into 20 grams of cream and mix well. Pour back into egg whites and mix well. Pour into a 6-inch mold lined with oiled paper and bake at 170 degrees for 28 minutes.; Melt the chocolate heat-insulated water, add 80 grams of cream and stir until smooth.Add 300 grams of whipped cream and sugar and beat until 60%. Take 100 grams of chocolate sauce and pour it into the whipped cream and continue beating. The remaining chocolate sauce is kept warm.; Divide the cake into three slices, spread one slice with cream and cover with another slice of cake Repeat the above steps to smooth the circumference and surface.; Put the remaining cream into a piping bag and squeeze it on the surface. Pour the remaining chocolate into the middle and smooth it out and refrigerate to solidify.','I like it so much! Strongly suggest you try it!','2022-05-29',4,0,4,82),(49,'Japanese rice balls','I made a super delicious Japanese rice ball for myself at noon. The method is super simple, but it is really delicious. ','Add diced ham and diced carrots to the rice, add a little salt, pepper, and two tablespoons of cooking oil, stir well, and knead into a triangular rice ball.; Make sauce: a spoonful of soy sauce, a spoonful of oyster sauce, half a spoon of white sugar and mix well.; Brush a layer of oil on a frying pan, add the rice balls and fry them on a low heat, brush the surface with two layers of sauce after frying, cover with seaweed, sprinkle with white sesame seeds and fry until both sides are golden brown!','You can use leftover rice to do this! also delicious.','2022-05-29',4,0,2,83),(50,'Szechuan Peppercorn Chicken','This is a dish for all real Sichuan food lovers especially for those who loves the numbing feeling of Sichuan peppercorn.','n a large pot, add scallion, ginger, Sichuan peppercorn and water. Heat to a boiling, let it simmer for 5 minutes and then turn off fire and stand for 10 minutes. Remember to remove the foams after boiling.Once the meat can be insert through, it is just cooked. Place the chicken leg in iced water.; Cut into large pieces. And transfer chicken to serving plate with smashed cucumber.  At the same time, scoop around 1 cup of chicken stock to cool down.; Heat around 2 tablespoons of vegetable cooking in a small pot, add garlic, ginger and scallion until aromatic. ; Place red Sichuan peppercorn and green Sichuan peppercorn in.; Place fresh peppers in. Slightly heat for a while. Turn off fire, add white pepper, chicken stock (cooled), light soy sauce, oyster sauce and salt. Pour sauce in. Let them soak 30 minutes before eating.','Szechuan pepper can help to create a numb feeling of your tongue. If you ever tried the Mala taste of Sichuan cuisine, then it is Szechuan peppercorn that brings the ma taste.','2022-05-29',5,0,1,84),(52,'Szechuan Eggplants','Szechuan braised eggplants is a great rice killer eggplant recipe.','Cut eggplant into strips. Then soak the eggplant strips in salty water for around 15 minutes. Move out and completely drain.; Heat another 1 tablespoon of oil in wok, and fry mince pork until crisp and browned. Then transfer the pork out.; Add another 2 tablespoons of oil and add eggplants in. Fry until slightly softened.; Transfer eggplant out, then fry Doubanjiang and dou-chi if using over slow fire until the oil turns red. Then place garlic, ginger and scallion, also pepper flakes and Sichuan peppercorn if using. Fry until aroma.; Return eggplant and fried pork , add sugar, salt and light soy sauce. Give a big stir fry to make everything well mixed and serve hot!','In order to reduce the oil absorbed during the pan-frying process and fasten the process, we should soak the eggplant strips in salty water for around 15 minutes. Water absorbed can speed up the cooking process.','2022-05-29',5,0,1,86),(53,'Tangyuan-Black Sesame Filling','Tang Yuan is a popular sweet dessert, used to celebrate holidays including Lantern Festival, but is served as desserts now and sometimes as breakfast in cold winter mornings.','Toast black sesame in a pan or oven ; Add black sesame, powdered sugar, salt and peanuts into a blender. Blend well.; Add melted lard and water. Mix well. Then chill until hardened and then shape ½ tablespoon of the filling into round balls. Cover with plastic wrapper and chill in fridge again.; Stir warm water to sticky rice flour and then knead to form a smooth ball.; Shape to a long log and shape into 6 portions. Cover 4 portions with wet cloth.; Halve the remaining 2 portions and turn into 4 portions. Add vegetable color powder one by one and knead until the color is well mixed. Sprinkle water whenever necessary.; Mix the colored dough with the white dough roughly (to create the marbled surface). Take a 20g portion and then shape to a small ball, place the dough in and wrap well. Squeeze the ball in turn in two hands to make sure no cracks on surface. If you feel the dough is hard to handle, wet your hand before assembling. Slightly dust the ball with sticky rice flour for further storage. They can be frozen in air-tight bags.; Bring water to a boiling in a pot (the water should be at least 2 cm higher than the balls). Continue cooking for another 1-2 minutes after they float on surface.; Scoop out with the soup and serve with sugar, or sweet osmanthus or syrup.','When shaping the bowl, we need to make the bottom thicker while the other parts uniform. If the bottom is too thin, the balls might break during the shaping process.','2022-05-29',5,0,1,87),(54,'Slow Cooker Baby Back Ribs','These baby back ribs cooked in a crockpot are the best I\'ve had, short of the actual grilling method of course! This is a very simple recipe that I came up with a few years ago. It\'s not rocket science, just ribs cooked in the slow cooker and finished with barbeque sauce in the oven. This is what I do when I want ribs during the week and have to work all day. I\'m eating them within 30 minutes of getting home, and they turn out perfect every time!','Season ribs with salt and pepper.; Pour 1/2 cup water into the slow cooker, then add ribs. Scatter onion and garlic over top.; Cover and cook on Low for 8 hours or High for 4 hours.; When the ribs are almost finished, preheat the oven to 375 degrees F (190 degrees C).; Transfer ribs from the slow cooker to a baking sheet and coat with barbeque sauce. Discard onion and garlic.; Bake ribs in the preheated oven until sauce caramelizes and sticks to meat, 10 to 15 minutes.','Nutrition Facts Per Serving: 501 calories; protein 24.3g; carbohydrates 32.4g; fat 29.6g; cholesterol 117mg; sodium 1067.4mg.','2022-05-29',2,0,6,88),(56,'Chocolate Cake (Kladdkaka) ','','1.Preheat the oven to 350°F (180°C).; 2.In a medium bowl, whisk the sugar and eggs until the mixture is pale yellow in color.; 6.Grease a pan with butter and sprinkle cocoa powder to coat.; 8.Bake for 20 minutes or until the top has hardened. The center should still be soft.','','2022-05-29',7,0,4,90),(57,'Coconut Milk Pancake','This recipe creates a thick fluffy pancake. Top them off with your favorite syrup, toasted coconut, whipped cream, or berries for a delectable start to the day.','Combine flour, sugar, baking powder, baking soda, and salt together in a bowl. ; Whisk coconut milk, egg, butter, and vanilla extract together in a separate bowl; stir into the flour mixture just until batter is combined.; Heat a lightly oiled griddle over medium-high heat. Drop batter by large spoonfuls onto the griddle and cook until bubbles form and the edges are dry, 3 to 4 minutes.; Flip and cook until browned on the other side, 1 to 2 minutes. Repeat with remaining batter.','Nutrition Facts Per Serving: 200 calories; protein 3.8g; carbohydrates 18.9g; fat 12.7g; cholesterol 27.1mg; sodium 310.7mg.','2022-05-29',2,0,8,91),(58,'Pancake','','Melt 3 tablespoon unsalted butter and let cool slightly. Place 2 cups milk, 1 cup flour, 3 large eggs, the melted butter, 1 tablespoon granulated sugar, and 1/4 teaspoon kosher salt in a blender. Blend until smooth, about 20 seconds. (Alternatively, whisk everything together in a bowl until thoroughly combined and frothy.); Melt 1 teaspoon unsalted butter in a 10-inch nonstick pan over medium heat. Tilt the pan so the butter coats the bottom. Pour in about 1/3 cup of the batter, then immediately pick up the pan and swirl it to spread the batter into an even layer on the bottom of the pan. Cook until the pancake has browned slightly on the bottom, 1 to 1 1/2 minutes.arefully slide a spatula underneath the pancake and flip it. Cook the second side briefly, just to set the batter, 15 to 30 seconds more. Tilt the pan and loosen the pancake, then slide it onto a wire rack.; Continue making pancakes with the rest of the batter, adding more butter 1 teaspoon at a time, as needed, to keep them from sticking. Stack the pancakes to keep them warm. To serve, roll each pancake up. Serve the pancakes with toppings, as desired.','','2022-05-29',7,0,2,92),(59,'Tasty BBQ Corn on the Cob','This is corn on the cob cooked on the grill with spices and butter. It makes for a yummy side dish to any meal! Try it with fresh garlic and onion.','Preheat grill for medium-high heat.; In a medium bowl, mix together the chili powder, oregano, onion powder, cayenne pepper, garlic powder, salt, and pepper. Blend in the softened butter.; Apply this mixture to each ear of corn, and place each ear onto a piece of aluminum foil big enough to wrap the corn. ; Wrap like a burrito, and twist the ends to close.; Place wrapped corn on the preheated grill, and cook 20 to 30 minutes, until tender when poked with a fork. Turn corn occasionally during cooking.','Nutrition Facts Per Serving: 216 calories; protein 3.2g; carbohydrates 17.7g; fat 16.5g; cholesterol 40.7mg; sodium 127.1mg.','2022-05-29',2,0,6,93),(60,'Patty Melt','','Heat the olive oil in a large, heavy-bottomed saucepan on medium heat. Add the onions, stir briefly to coat with oil and cook without stirring for 10-12 minutes.; Flip so that the onions on the bottom of the pot are now on top, and cook for another 10-12 minutes. Flip one more time, lower heat and allow onions to caramelized until completely brown — about 15 minutes — gently stirring occasionally. Remove from heat and set aside. These can be reheated before you put the burgers together.; Preheat your grill, grill pan or cast-iron skillet to high heat and add burger patties. If using a grill, cover with the lid.; Cook until the crust that forms on the bottom of the burger releases it from the pan or grate — about 2 minutes. Gently test, but don\'t flip it until it gets to this point. When burgers lift up easily, flip and cook on the other side for another 2-3 minutes for medium to medium rare, then transfer to a plate and allow to rest.; Assemble the patty melts: spread both slices of bread for each sandwich with thousand island dressing, then add a patty, two slices of American cheese and top with caramelized onions.; Preheat a cast-iron skillet and melt half a tablespoon of butter for each sandwich. Drop a sandwich in, press down with a spatula and grill until golden brown, about 2-3 minutes. Flip and grill on the other side.','','2022-05-29',7,0,2,94);
